import React from "react";
import Carousel from "react-bootstrap/Carousel";

const Carousell = (props) => {
  let carousell = props.shows.map((show) => {
    return (
      <Carousel.Item interval={2000}>
        <img className="d-block w-100" src={show.image} alt={show.name} />
        <Carousel.Caption>
          <p className="carousel-title">{show.name}</p>
        </Carousel.Caption>
      </Carousel.Item>
    );
  });

  return (
    <>
      <Carousel>{carousell}</Carousel>
      <br />
    </>
  );
};

export default Carousell;
